import React from 'react';
import '../style/PurchasePagesub.css';


function PurchasePagesub() {
    return (
        <section className='product'>
            <div className='content'>
                <div className='pic_bread'></div>
                <div className='text'>
                    <h1>香料番茄醬(全素)</h1>
                    <p>NT$780</p>
                    <hr />
                    <p>尺寸: 50x30cm <br /> 品牌: 棉花花 <br /> 認證: 國際有機天然食品認證 <br /> 成份: 亞麻仁、椰子粉、米穀粉、玫瑰鹽、天然酵母、天然奶油 <br />橄欖油、  </p>
                </div>

            </div>

        </section>




        );
}
export default PurchasePagesub;
